DELIMITER $$
CREATE TRIGGER `after_voucher_master_delete` AFTER DELETE ON `voucher_master` FOR EACH ROW BEGIN
    IF OLD.vm_type = 'PAYMENT' THEN
        IF OLD.vm_constant = 'DEBIT_NOTE' THEN -- DEBIT NOTE A/C --
            UPDATE account_master acc
            SET acc.account_amt_credited = acc.account_amt_credited - OLD.vm_total_amt
            WHERE acc.account_id = OLD.vm_acc_id;
            
            UPDATE account_master party
            SET party.account_amt_debited = party.account_amt_debited - (OLD.vm_total_amt + OLD.vm_round_off)
            WHERE party.account_id = OLD.vm_party_id;
        ELSE
            UPDATE account_master acc
            SET acc.account_amt_debited = acc.account_amt_debited - OLD.vm_total_amt
            WHERE acc.account_id = OLD.vm_acc_id;

            UPDATE account_master party
            SET party.account_amt_credited = party.account_amt_credited - (OLD.vm_total_amt + OLD.vm_round_off)
            WHERE party.account_id = OLD.vm_party_id;
        END IF;
    ELSE
        IF OLD.vm_constant = 'CREDIT_NOTE' THEN -- CREDIT NOTE A/C --
            UPDATE account_master acc
            SET acc.account_amt_debited = acc.account_amt_debited - OLD.vm_total_amt
            WHERE acc.account_id = OLD.vm_acc_id;
            
            UPDATE account_master party
            SET party.account_amt_credited = party.account_amt_credited - (OLD.vm_total_amt + OLD.vm_round_off)
            WHERE party.account_id = OLD.vm_party_id;
        ELSE
            UPDATE account_master acc
            SET acc.account_amt_credited = acc.account_amt_credited - OLD.vm_total_amt
            WHERE acc.account_id = OLD.vm_acc_id;

            UPDATE account_master party
            SET party.account_amt_debited = party.account_amt_debited - (OLD.vm_total_amt + OLD.vm_round_off)
            WHERE party.account_id = OLD.vm_party_id;
        END IF;
    END IF;
END
$$
