--
DELIMITER $$
CREATE TRIGGER `after_voucher_trans_delete` AFTER DELETE ON `voucher_trans` FOR EACH ROW BEGIN
	    IF OLD.vt_pm_id != 0 THEN -- purchase --
	    	UPDATE purchase_master pm
	        SET pm.pm_allocated_amt = pm.pm_allocated_amt - OLD.vt_adjust_amt,
	        pm.pm_allocated_round_off = pm.pm_allocated_round_off - OLD.vt_adjust_round_off,
	        pm.pm_return_qty = pm.pm_return_qty - OLD.vt_return_qty,
	        pm.pm_return_amt = pm.pm_return_amt - OLD.vt_return_amt
	        WHERE pm.pm_id = OLD.vt_pm_id;
	    END IF;
	    
	    IF OLD.vt_sm_id != 0 THEN -- sales --
	    	UPDATE sales_master sm
	        SET sm.sm_allocated_amt = sm.sm_allocated_amt - OLD.vt_adjust_amt,
	        sm.sm_allocated_round_off = sm.sm_allocated_round_off - OLD.vt_adjust_round_off,
	        sm.sm_return_qty = sm.sm_return_qty - OLD.vt_return_qty,
	        sm.sm_return_amt = sm.sm_return_amt - OLD.vt_return_amt
	        WHERE sm.sm_id = OLD.vt_sm_id; 
	    END IF;

	    IF OLD.vt_gm_id != 0 THEN -- grn --
	    	UPDATE grn_master gm
	        SET gm.gm_allocated_amt = gm.gm_allocated_amt - OLD.vt_adjust_amt,
	        gm.gm_allocated_round_off = gm.gm_allocated_round_off - OLD.vt_adjust_round_off
	        WHERE gm.gm_id = OLD.vt_gm_id; 
	    END IF;

	    IF OLD.vt_om_id != 0 THEN -- outward --
	    	UPDATE outward_master om
	        SET om.om_allocated_amt = om.om_allocated_amt - OLD.vt_adjust_amt,
	        om.om_allocated_round_off = om.om_allocated_round_off - OLD.vt_adjust_round_off
	        WHERE om.om_id = OLD.vt_om_id; 
	    END IF;
	END
$$
